import '../components/Descript.css';

const Descript = () =>{
	return(
	<div className="descriptBack">
		<div className="whatRamen">
			<h1> What is the Ramen Report?</h1>
			<p>A site where you can rate leave a review of the bowl of ramen you've eaten.
				What's better is that you can see which bowl ranks highest and where you can find the teastiest bowl of ramen in your area.
			</p>
		</div>
	</div>
	)
}

export default Descript;
